import React from "react";
import { Input, Button } from "antd";
import youtube from "../../api/youtube";

const { Search } = Input;

export const SeachBar = () => {
  return (
    <div>
      <Search
        onChange={props.handleChange}
        onPressEnter={props.handleSubmit}
        onSearch={props.handleSubmit}
        enterButton
        size="middle"
        type="text"
        style={{
          width: 800,
        }}
      />
      <Button type="primary" onClick={props.saveLocal}>
        Save
      </Button>
    </div>
  );
};
